<!DOCTYPE html>
<html lang="pt-BR">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Vídeo</title>
<style>
    body {
        display: flex;
        flex-direction: column;
        align-content: center;
        align-items: center;
        background-color: #b7b5b6;
        height: 97vh;
    }
    .row {
        display: flex;
        line-height: 16px;
        align-items: center;
        max-width: 881px;
    }
    .row:hover {
        background-color: #f5af6163;
    }
    span.spn-play {
        cursor: pointer;
    }
    div.timesdiv {
        margin: 5px 6px;
        vertical-align: middle;
        padding: 2px;
        font-family: verdana, sans-serif;
        font-size: 14px;
        user-select: none;
    }
    div.div-btn {
        user-select: none;
    }
    .container {
        height: 100vh;
        overflow-y: auto;
        background-color: #FFFFEA;
        font-family: monospace;
        padding: 12px 2px;
    }
    .centered-content {
        position: sticky;
        top: 50%; /* Mantém a div centralizada verticalmente */
        transform: translateY(-50%); /* Ajusta a posição para centralizar verticalmente */
        background-color: yellow; /* Apenas para visualização */
        padding: 10px;
        border: 1px solid #000;
        }

        .custom_input {
            display: flex;
            align-items: center;
            position: relative;
            max-width: 100%;
            width: 628px;
            margin: 5px 0px;
        }
        .input {
            font-size: 18px;
            padding: 5px 10px;
            width: 100%;
            padding-left: 35px;
            outline: none;
            background: #FFFFFF;
            color: #000000;
            border: 1px solid #C4D1EB;
            border-radius: 5px;
            box-shadow: 3px 3px 2px 0px #E2E2E2;
            transition: .3s ease;
        }

        .input:focus {
            background: #F2F2F2;
            border: 1px solid #5A7EC7;
            border-radius: 10px;
        }

        .input::placeholder {
            color: #DDDDDD;
        }

        .svg_icon {
            position: absolute;
            left: 10px;
            fill: #4660DC;
            width: 18px;
            height: 18px;
        }


</style>

    <script>
        function padronizarTempo(tempo) {
            // Separar a parte do tempo em horas, minutos, segundos e milissegundos (se existirem)
            let [horas, minutos, resto] = tempo.split(':');

            // Separar segundos e milissegundos (separados por .)
            let [segundos, milissegundos] = resto.split('.');

            // Se os milissegundos não existirem, definir como "000"
            milissegundos = milissegundos ? milissegundos.padEnd(3, '0').slice(0, 3) : '000';

            // Garantir que horas, minutos e segundos tenham 2 dígitos
            horas = horas.padStart(2, '0');
            minutos = minutos.padStart(2, '0');
            segundos = segundos.padStart(2, '0');

            // Retornar o tempo padronizado no formato hh:mm:ss.mmm
            return `${horas}:${minutos}:${segundos}.${milissegundos}`;
        }


        function base64ToJson(base64String) {
            try {
        // Decodifica a string Base64 para uma string ISO-8859-1
        const isoString = atob(base64String);
        // Converte a string ISO-8859-1 para uma string UTF-8
        const utf8String = decodeURIComponent(escape(isoString));
        return JSON.parse(utf8String);
        
    } catch (error) {
        console.error('Erro ao processar a string Base64:', error.message);
        return null;
    }

        const object = base64ToJson(xmUlrkuisjy);
        const linkYouTube = 'https://www.youtube.com/watch?v=nBMCmQI-c7s';

        function createView(dados){            
            let htmlReturn="";
            for (const cdReg of dados){
                let timeInit = padronizarTempo(cdReg['timeinit']);
                let timeEnd = padronizarTempo(cdReg['timeend']);
                htmlReturn = htmlReturn + `
                    <div class="row">
                        <div class="div-btn"><span class="spn-play" data-time="${cdReg['second']}"> ▶️ </span></div>
                        <div class="timeinit timesdiv">${timeInit}</div>
                        <div class="timeend timesdiv">${timeEnd}</div>
                        <div class="text">${cdReg['texto']}</div>
                    </div>
                `;
            }
            return htmlReturn;
        };

        function showText(element, jsonObject){
            element.innerHTML = createView(jsonObject);
            let btnsPlay = element.querySelectorAll('.spn-play');
            btnsPlay.forEach((cdSpan) => {
                cdSpan.addEventListener('click', (evtSpn)=>{
                    let _Popup = window.open(`${linkYouTube}&t=${evtSpn.target.dataset.time}s`,'_blank')                    
                });
            });
        }

        (function main(win,doc){
            let container = doc.querySelector('.container');
            let allObject = 
            showText(container,object);
            
               
                // Função debounce
            const debounce = (func, delay) => {                
                let timeoutId;
                return (...args) => {
                    if (timeoutId) {
                        clearTimeout(timeoutId);
                    }
                    timeoutId = setTimeout(() => {
                        func(...args);
                    }, delay);
                };
            };

                // Função que será chamada com debounce
                const handleSearch = (event) => {
                    
                    let container = document.querySelector('.container');
                    let input = event.target.value.toLowerCase(); // Converte para minúsculas para uma busca case-insensitive
                    
                    // Filtra o objeto com base no valor da chave 'texto'
                    let newObj = object.filter(item => item.texto.toLowerCase().includes(input));
                    
                    // Atualiza o conteúdo da div                    
                    showText(container,newObj);                    
                };

                // Cria a função debounce
                const debouncedSearch = debounce(handleSearch, 300); // Ajuste o atraso conforme necessário

                // Adiciona o event listener com a função debounce
                let btnSrch = doc.querySelector('#btnSearch');                
                btnSrch.addEventListener('keyup', debouncedSearch);

        })(window, document);

        document.addEventListener('DOMContentLoaded', function() {
            function adjustDivHeight() {
                let header = document.querySelector('div.custom_input');
                var content = document.querySelector('div.container');
                let headerHeight = header.offsetHeight + 60;
                var viewportHeight = window.innerHeight;                
                // Ajusta a altura da div
                content.style.height = (viewportHeight - headerHeight) + 'px';
            }

            // Ajuste a altura quando a página é carregada
            adjustDivHeight();

            // Ajuste a altura quando a janela é redimensionada
            window.addEventListener('resize', adjustDivHeight);
    });
